import React from 'react';
import { Container, Row, Col, Image } from 'react-bootstrap';

import SignImage from '../../assets/images/sign.png'; 

import './styles.css';

function Sign() {
  return (
    <Container>
      <Row>
        <Col xs={12} md={12} lg={12}>
          <Image src={SignImage} fluid/>
        </Col>
      </Row>
      <Row>
        <Col xs={12} md={12} lg={12}>
          <h1>Vincule seu celular agora</h1>
        </Col>
      </Row>
      <Row>
        <Col xs={12} md={12} lg={12}>
          <h1>Para utilizar você precisa ativar este aparelho, informe o número do seu celular e solicite um código de ativação que será enviado por SMS.</h1>
        </Col>
      </Row>
   </Container>
  );
}

export default Sign;
